snippet.textDisplay:
@Ana Santos então eu estou com o corpo dolorido demais, tosse , garganta arranhando muito, a perna direita pesada tipo coagulação sanguínea estranha, corpo quente nunca passa , muita moleza ...tipo uma gripe mesmo. Ah com falta de ar e tosse seca. Tenho asma e bronquite. Agora se durante essas 2 semanas não melhorar, terei que ir novamente ao médico.
Fui ao médico ontem a tarde fiz o teste e deu positivo.
O médico pediu afastamento tipo do trabalho, onde frequento por 2 semanas

